<!DOCTYPE html>
<html lang="de">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <meta content="Suicide Tools - Quiz" property="og:title" />
    <meta content="Find out which method suits you best!" property="og:description" />
    <meta content="https://suicide.tools/quiz" property="og:url" />
    <meta content="../images/strick.png" property="og:image" />
    <meta content="#c91515" data-react-helmet="true" name="theme-color" />
    <!-- Favicon -->
    <link rel="shortcut icon" type="image/x-icon" href="../images/strick.png" />
    <title>Suicide Tools - Quiz</title>
    <link rel="stylesheet" href="../css/style.css">
    <style>
        body {
            font-family: Arial, sans-serif;
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            margin: 0;
            background-color: #1b1b1b;
            /*background-color: transparent;*/
            /*background-color: rgba(27, 27, 27, 0.18);*/
            color: #ffffff;
            user-select: none;
        }

        img {
            user-select: none;
            -webkit-user-drag: none;
        }

        .container {
            width: 80%;
            max-width: 600px;
            background: #2b2b2b;
            padding: 20px;
            box-shadow: 0 0 15px rgba(0, 0, 0, 0.5);
            border-radius: 15px;
            overflow: hidden;
            position: relative;
            transition: height 0.7s ease;
        }

        h1 {
            font-size: 24px;
            margin-bottom: 20px;
            text-align: center;
            font-weight: bold;
        }

        h2 {
            font-size: 22px;
            margin-bottom: 0px;
            text-align: center;
            font-weight: bold;
            color: #fff;
        }

        #result-text {
            margin: 5px 0 40px 0;
        }

        .question {
            margin-bottom: 20px;
            transition: transform 0.7s ease, opacity 0.7s ease;
            /*height: 85px;*/
            height: 100px;
        }

        label {
            display: block;
            margin-bottom: 10px;
        }

        .custom-slider {
            width: 100%;
            margin: 15px 0;
            position: relative;
        }

        .custom-slider input[type="range"] {
            -webkit-appearance: none;
            width: 100%;
            height: 10px;
            background: linear-gradient(90deg, #ff4d4d, #ff1a1a);
            border-radius: 5px;
            outline: none;
            opacity: 0.9;
            transition: opacity 0.2s;
        }

        .custom-slider input[type="range"]::-webkit-slider-thumb {
            -webkit-appearance: none;
            appearance: none;
            width: 20px;
            height: 20px;
            border-radius: 50%;
            background: #ffffff;
            cursor: pointer;
            transition: background 0.3s, transform 0.3s ease;
        }

        .custom-slider input[type="range"]::-moz-range-thumb {
            width: 20px;
            height: 20px;
            border-radius: 50%;
            background: #ffffff;
            cursor: pointer;
            transition: background 0.3s, transform 0.3s ease;
        }

        .custom-slider input[type="range"]:hover {
            opacity: 1;
        }

        .custom-slider input[type="range"]:active::-webkit-slider-thumb {
            transform: scale(1.2);
        }

        .custom-slider input[type="range"]:active::-moz-range-thumb {
            transform: scale(1.2);
        }

        .range-labels {
            display: flex;
            justify-content: space-between;
            font-size: 12px;
            margin-top: 5px;
        }

        button {
            display: block;
            width: 100%;
            padding: 10px;
            border: none;
            background-color: #ff3333;
            color: white;
            font-size: 16px;
            border-radius: 5px;
            cursor: pointer;
            transition: background-color 0.3s, opacity 0.3s, transform 0.3s;
            margin-top: 10px;
        }

        button:active {
            transform: scale(0.98);
        }

        button:hover {
            background-color: #ff1a1a;
        }

        button:disabled {
            background-color: #777;
            cursor: not-allowed;
            opacity: 0.6;
        }

        .result {
            display: none;
            text-align: center;
            opacity: 0;
            transform: translateY(100%);
            transition: transform 0.7s ease, opacity 0.7s ease;
        }

        .progress {
            margin-bottom: 40px;
            text-align: center;
        }

        .hidden {
            display: none;
        }

        .enter {
            animation: slideIn 0.5s forwards;
        }

        .exit {
            animation: slideOut 0.5s forwards;
        }

        hr {
            border: 0;
            height: 1px;
            background: rgba(255, 0, 0, 0.45);
            margin: 20px auto;
            width: 50%;
        }

        @keyframes slideIn {
            from {
                transform: translateX(100%);
                opacity: 0;
            }
            to {
                transform: translateX(0);
                opacity: 1;
            }
        }

        @keyframes slideOut {
            from {
                transform: translateX(0);
                opacity: 1;
            }
            to {
                transform: translateX(-100%);
                opacity: 0;
            }
        }

        .loading {
            display: none;
            text-align: center;
            opacity: 0;
            transition: opacity 0.35s ease;
        }

        .fadeIn {
            animation: fadeIn 0.35s forwards;
        }

        .fadeOut {
            animation: fadeOut 0.35s forwards;
        }

        @keyframes fadeIn {
            from {
                opacity: 0;
            }
            to {
                opacity: 1;
            }
        }

        @keyframes fadeOut {
            from {
                opacity: 1;
            }
            to {
                opacity: 0;
            }
        }

        @keyframes slideUp {
            from {
                transform: translateY(100%);
                opacity: 0;
            }
            to {
                transform: translateY(0);
                opacity: 1;
            }
        }

        @keyframes slideDown {
            from {
                transform: translateY(0);
                opacity: 1;
            }
            to {
                transform: translateY(100%);
                opacity: 0;
            }
        }

        .slideUp {
            animation: slideUp 0.7s forwards;
        }

        .slideDown {
            animation: slideDown 0.7s forwards;
        }
    </style>
</head>
<body>
<!--
	Start Preloader
	==================================== -->
<div class="preloader">
    <div class="sk-cube-grid">
        <div class="sk-cube sk-cube1"></div>
        <div class="sk-cube sk-cube2"></div>
        <div class="sk-cube sk-cube3"></div>
        <div class="sk-cube sk-cube4"></div>
        <div class="sk-cube sk-cube5"></div>
        <div class="sk-cube sk-cube6"></div>
        <div class="sk-cube sk-cube7"></div>
        <div class="sk-cube sk-cube8"></div>
        <div class="sk-cube sk-cube9"></div>
    </div>
</div>
<!-- End Preloader
==================================== -->
<div class="container" id="container">
<!--    <div onclick="debug_skipToResult()">Skip to Result</div>-->
        <h1><img src="../images/logo.png" alt="Website Logo" width="50%"/></h1>
<!--    <h1>suicide.tools</h1>-->
    <hr>
    <div class="progress" id="progress-container">Question <span id="current-question">1</span> of 13</div>
    <div id="quiz">
        <div class="question" id="question-container"></div>
        <button id="next-btn">Next question</button>
    </div>
    <div class="loading" id="loading-container">
        <h2>Loading...</h2>
    </div>
    <div class="result" id="result-container">
        <h2>Your result:</h2>
        <p id="result-text"></p>
        <button id="redo-btn">Wanna do it again?</button>
    </div>
</div>
